package weekly_contest._168._3;

import java.util.HashMap;
import java.util.Map;

/**
 * @Description:
 * @Author: wangyinghao_sx
 * @Date: 2019-12-22 11:07
 **/
public class Solution {
    public int maxFreq(String s, int maxLetters, int minSize, int maxSize) {
        int max = 0;
        for (int i = minSize; i <= maxSize; i++) {
            Map<String, Boolean> sContainsDiffChNums = new HashMap<>();
            Map<String, Integer> sNumsMap = new HashMap<>();
            for (int j = 0; j <= s.length() - i; j++) {
                String sIndex = s.substring(j, j + i);
                boolean flag = sContainsDiffChNums(sIndex, maxLetters);
//                if (!sContainsDiffChNums.containsKey(sIndex)) {
//                    flag = sContainsDiffChNums(sIndex, maxLetters);
//                    sContainsDiffChNums.put(sIndex, flag);
//                } else {
//                    flag = sContainsDiffChNums.get(sIndex);
//                }
                if (!flag) {
                    continue;
                }
                if (!sNumsMap.containsKey(sIndex)) {
                    sNumsMap.put(sIndex, 1);
                } else {
                    sNumsMap.put(sIndex, sNumsMap.get(sIndex) + 1);
                }
            }
            for (Map.Entry<String, Integer> stringIntegerEntry : sNumsMap.entrySet()) {
                if (stringIntegerEntry.getValue() > max) {
                    max = stringIntegerEntry.getValue();
                }
            }
        }
        return max;
    }

    public boolean sContainsDiffChNums(String sIndex, int maxLetters) {
        int res = 0;
        Map<String, Integer> map = new HashMap<>();
        for (int i = 0; i < sIndex.length(); i++) {
            if (!map.containsKey(String.valueOf(sIndex.charAt(i)))) {
                map.put(String.valueOf(sIndex.charAt(i)), 1);
                res++;
                if (res > maxLetters) {
                    return false;
                }
            }
        }
        return true;
    }

    public static void main(String[] args) {
        String s = "";
        int maxLetters = 3;
        int minSize = 5;
        int maxSize = 26;
        new Solution().maxFreq(s, maxLetters, minSize, maxSize);
    }
}
